CREATE TABLE `eb_player_timing` (
  `PT_ID` varchar(64) NOT NULL COMMENT 'ID',
  `PT_PY_ID` varchar(255) DEFAULT NULL COMMENT '端终ID',
  `PT_Monday_Opentime` varchar(255) DEFAULT NULL COMMENT '周一开机时间',
  `PT_Monday_Closetime` varchar(255) DEFAULT NULL COMMENT '周一关机时间',
  `PT_Monday_Switch` int(11) DEFAULT NULL COMMENT '周一时间设置是否生效（0否，1是）',
  `PT_Tuesday_Opentime` varchar(255) DEFAULT NULL,
  `PT_Tuesday_Closetime` varchar(255) DEFAULT NULL,
  `PT_Tuesday_Switch` int(11) DEFAULT NULL,
  `PT_Wednesday_Opentime` varchar(255) DEFAULT NULL,
  `PT_Wednesday_Closetime` varchar(255) DEFAULT NULL,
  `PT_Wednesday_Switch` int(11) DEFAULT NULL,
  `PT_Thursday_Opentime` varchar(255) DEFAULT NULL,
  `PT_Thursday_Closetime` varchar(255) DEFAULT NULL,
  `PT_Thursday_Switch` int(11) DEFAULT NULL,
  `PT_Friday_Opentime` varchar(255) DEFAULT NULL,
  `PT_Friday_Closetime` varchar(255) DEFAULT NULL,
  `PT_Friday_Switch` int(11) DEFAULT NULL,
  `PT_Saturday_Opentime` varchar(255) DEFAULT NULL,
  `PT_Saturday_Closetime` varchar(255) DEFAULT NULL,
  `PT_Saturday_Switch` int(11) DEFAULT NULL,
  `PT_Sunday_Opentime` varchar(255) DEFAULT NULL,
  `PT_Sunday_Closetime` varchar(255) DEFAULT NULL,
  `PT_Sunday_Switch` int(11) DEFAULT NULL,
  `PT_Check_Switch` int(11) DEFAULT NULL COMMENT '是否监听程序',
  PRIMARY KEY (`PT_ID`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

