#
# Procedure "sp_get_inc_id"
#

CREATE PROCEDURE `sp_get_inc_id`(NAME varchar(50),out VALUE int)
BEGIN
  DECLARE IDVALUE int;
start transaction;
  SET IDVALUE = (select ID_VALUE+1 FROM ID_CODEID WHERE ID_NAME = NAME);
	UPDATE ID_CODEID SET ID_VALUE = ID_VALUE + 1 WHERE ID_NAME = NAME;
commit;
   set VALUE = IDVALUE;
END;
